// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import AddExpense from "./pages/AddExpense";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Welcome from "./pages/Welcome"; // Importing the new Welcome page

const App = () => {
  return (
    <Router>
      <div className="container mx-auto">
        {/* Navigation Bar */}
        <nav className="bg-black p-4">
          <h1 className="text-3xl text-gold font-bold mb-4 text-center">Fitness Assistant</h1>
          <div className="flex justify-center space-x-4">
            <Link to="/" className="text-white text-lg hover:text-gold">Home</Link>
            <Link to="/login" className="text-white text-lg hover:text-gold">Login</Link>
            <Link to="/signup" className="text-white text-lg hover:text-gold">Sign Up</Link>
            <Link to="/add-expense" className="text-white text-lg hover:text-gold">Add Expense</Link>
            <Link to="/dashboard" className="text-white text-lg hover:text-gold">Dashboard</Link>
          </div>
        </nav>

        {/* Main Content */}
        <Routes>
          <Route path="/" element={<Welcome />} /> {/* Welcome page as homepage */}
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/add-expense" element={<AddExpense />} />
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
